import React from 'react';
import Toolbar from './components/HOMEPAGE/res-nav/res-nav.component';
import SideDrawer from './components/HOMEPAGE/sideDrawer/sideDrawer.component';
import BackDrop from './components/HOMEPAGE/backdrop/backdrop.component';
import Header from '../../components/HOMEPAGE/header/header.component';
import HompepageHero from '../../components/HOMEPAGE/homepage-hero/homepage-hero.component';
import './homepage.style.css';

const HomePage = () => (
    <div className="homepage">
        <Toolbar />
        <SideDrawer />
        <BackDrop />
        <Header />
        <HompepageHero />
    </div>
);
export default HomePage;
